package Practice;

public class RelationalOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i=10;
		int j=15;
		
		System.out.println(i==j);
		System.out.println(i!=j);
		System.out.println(i>=j);
		System.out.println(i<=j);
		System.out.println(i>j);
		System.out.println(i<j);
		

	}

}
